import React from 'react';
import AyungonHeader from '../assets/AyungonHeader.png';
const Navbar = () => {
	return (
		<div className="flex bg-green-600 w-screen justify-between items-center">
			<div>
				<img
					className="w-80 "
					src={AyungonHeader}
					alt=""
				/>

				<div className="">
					<h2>asdasdasdsad</h2>
				</div>
			</div>
		</div>
	);
};

export default Navbar;
